import React from "react";
import { Link } from "react-router-dom";

function NotFound() {
  return (
    <div>
      <nav aria-label="breadcrumb">
        <ol className="breadcrumb">
          <li className="breadcrumb-item">
            <Link to="/">
              <i className="fas fa-home"></i> Home
            </Link>
          </li>
        </ol>
      </nav>

    </div>
  )
}




export default NotFound;
